import logo from './logo.svg';
import './App.css';
import Form from './components/form/form'

function App() {
  return (
    <div className="App">
      <header className="App-header">
		<h3>Bem-vindo ao teste de detecção de sigmanos!</h3>
        <h4>Utilização da página</h4>
		<p>Insira um array de strings;
		e clique no botão para checar se a representação do DNA corresponde a um sigmano.
        </p>
        <Form />
      </header>

    </div>
  );
}

export default App;
